const { Component } = require("react");
import DashboardHead from '../../layouts/Dashboard/DashboardHead';
import DashboardBody from '../../layouts/Dashboard/DashboardBody';
import HistoryView from '../../component/views/dashboard/historyView';

class History extends Component {
    render(){

        return(
            <div>
                <DashboardHead title="History"/>
                <DashboardBody >
                    <HistoryView token={this.props.query.token}/>
                </DashboardBody>
            </div>
        )

    }
}

export default History;
